        uint256 owing = balanceOf[msg.sender] * (dividendPerToken - dividendCreditedTo[msg.sender]);
        dividendBalanceOf[msg.sender] += owing;
        dividendCreditedTo[msg.sender] = dividendPerToken;
        msg.sender.call{value: dividendBalanceOf[msg.sender]}("");
        dividendBalanceOf[msg.sender] = 0;
    }

    function transferFrom(address _from, address _to, uint256 _value) public {
        require(_value <= allowance[_from][msg.sender]);
        require(_value <= balanceOf[_from]);
        dividendBalanceOf[_from] += balanceOf[_from] * (dividendPerToken - dividendCreditedTo[_from]);
        dividendCreditedTo[_from] = dividendPerToken;
        balanceOf[_from] -= _value;
        dividendBalanceOf[_to] += balanceOf[_to] * (dividendPerToken - dividendCreditedTo[_to]);
        dividendCreditedTo[_to] = dividendPerToken;
        balanceOf[_to] += _value;
        allowance[_from][msg.sender] -= _value;
    }

    function transfer(address _to, uint256 _value) public {
        require(balanceOf[msg.sender] >= _value);
        dividendBalanceOf[msg.sender] += balanceOf[msg.sender] * (dividendPerToken - dividendCreditedTo[msg.sender]);
        dividendCreditedTo[msg.sender] = dividendPerToken;
        balanceOf[msg.sender] -= _value;
        dividendBalanceOf[_to] += balanceOf[_to] * (dividendPerToken - dividendCreditedTo[_to]);
        dividendCreditedTo[_to] = dividendPerToken;
        balanceOf[_to] += _value;
    }

    fallback() external payable {
        if (totalSupply != 0) {
            dividendPerToken += msg.value / totalSupply;
        }
    }
}
